import { POST_ID, GET_ID, GETMY_ID } from '../actions/types'

const initialState = {
    UserId: [],
    UserInfo: [],
}
console.log(initialState.userId)

export default function (state = initialState, action) {
    switch (action.type) {
        case GET_ID:
            return {
                ...state,
                UserId: action.payload,
            }

        case GETMY_ID:
            return {
                ...state,
                UserInfo: action.payload,
            }
        default:
            return state
    }
}
